Rules.InvariantScript:
Table(
    { ID: 1, Title: "Sample" },
    { ID: 2, Title: "Another Crumb" }
)

With(
    {
        t: AddColumns(
            cmpBreadcrumbs.Crumbs,
            w,
            Len(Coalesce(ThisRecord.Title, "")) * 8 + 24
        )
    },
    Max(t, "w")
)

ControlPropertyState.AutoRuleBindingString:
// Widest breadcrumb = estimated text width + padding
With(
    {
        t: AddColumns(
               colBreadcrumbs,
               w, Len(Title) * 8 + 24   // column "w" stores width estimate
           )
    },
    Max(t, w)   // take the max of column "w" in table t
)
